import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Link } from 'react-router-dom';
import Head from './common/Head';
import Down from './common/Down';
import { useState } from 'react';

function App() {
  const[data, setdata] =useState(10)
  console.log(data);

  const[name,setname]=useState("hello")
  console.log(name);

  const handle_Increment = () => {
    setdata(data + 1)
    setname(name+"hello")
  }

  const handle_Decrement = () =>{
    setdata(data - 1)
    setname(name-"hello")
  }

  const[input1,setinput1] = useState('');
  const[input2,setinput2] = useState('1');

  return (
    <div className="App">
      <Head/>
      <div className='row'>
      <div className='col-6'>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
      </div>
      <div className='col-6'>
        <h1>{name}{data}
          <button onClick={handle_Increment}>ADD</button>
          <button onClick={handle_Decrement}>Sub</button>
        </h1>
        <label>Email</label>
        <input value={input1} type='text'  />
        <label>Password</label>
        <input type='Password' value={input2} />
        <Link to="/home">
        <button>Go to home</button>
        </Link>
      </div>
      </div>
      <Down/>
    </div>
  );
}

export default App;
